import React from 'react';
import './services.css';

function Services() {
  return (
    <div className="services-container">
      <h2>Наши Услуги</h2>
      <div className="service">
        <img src="/service1.jpg" alt="Услуга 1" />
        <h3>Услуга 1</h3>
        <p>Описание услуги 1...</p>
      </div>
      <div className="service">
        <img src="/service2.jpg" alt="Услуга 2" />
        <h3>Услуга 2</h3>
        <p>Описание услуги 2...</p>
      </div>
      {/* Добавьте еще услуги при необходимости */}
    </div>
  );
}

export default Services;
